  setTitle: "Buy why, some say, the moon?"
  setContent: "Buy why, some say, the moon? Why choose this as our goal? And they may as well ask why climb the highest mountain? <br /><br />As I stand out here in the wonders of the unknown at Hadley, I sort of realize there’s a fundamental truth to our nature, Man must explore . . . and this is exploration at its greatest."
  setIsActive: true
  setCreatedAt: 2015-01-01T00:00:00+0000
  setViewsCount: 20
-
  setTitle: "We want to explore."
  setContent: "We want to explore. We’re curious people. Look back over history, people have put their lives at stake to go out and explore … We believe in what we’re doing. Now it’s time to go. <br />Dinosaurs are extinct today because they lacked opposable thumbs and the brainpower to build a space program."
  setIsActive: true
  setCreatedAt: 2015-01-05T00:00:00+0000
  setViewsCount: 19
-
  setTitle: "NASA is not about the ‘Adventure of Human Space Exploration’…"
  setContent: "NASA is not about the ‘Adventure of Human Space Exploration’…We won’t be doing it just to get out there in space – we’ll be doing it because the things we learn out there will be making life better for a lot of people who won’t be able to go."
  setIsActive: true
  setCreatedAt: 2015-01-02T00:00:00+0000
  setViewsCount: 21
