  setTitle: "Контроль аппетита возможен"
  setContent: "Недавний прорыв, совершенный в области неврологии, обещает облегчить контроль аппетита, что является важнейшим фактором лечения пищевых Недавний прорыв, совершенный в области неврологии, обещает облегчить контроль аппетита, что является важнейшим фактором лечения пищевых"
  setIsActive: true
  setCreatedAt: 2015-02-01T00:00:00+0000
-
  setTitle: "I shall ere long paint to you as well as one can without canvas"
  setContent: "<p>I shall ere long paint to you as well as one can without canvas, something like the true form of the whale as he actually appears to the eye of the whaleman when in his own absolute body the whale is moored alongside the whale-ship so that he can be fairly stepped upon there. It may be worth while, therefore, previously to advert to those curious imaginary portraits of him which even down to the present day confidently challenge the faith of the landsman. It is time to set the world right in this matter, by proving such pictures of the whale all wrong.</p>"
  setIsActive: true
  setCreatedAt: 2015-01-01T00:00:00+0000
-
  setTitle: "It may be that the primal source of all those pictorial delusions"
  setContent: "<p>It may be that the primal source of all those pictorial delusions will be found among the oldest Hindoo, Egyptian, and Grecian sculptures. For ever since those inventive but unscrupulous times when on the marble panellings of temples, the pedestals of statues, and on shields, medallions, cups, and coins, the dolphin was drawn in scales of chain-armor like Saladin's, and a helmeted head like St. George's; ever since then has something of the same sort of license prevailed, not only in most popular pictures of the whale, but in many scientific presentations of him.</p>"
  setIsActive: true
  setCreatedAt: 2015-01-02T00:00:00+0000
